from sympy import divisors
def isok(n):
    dp = {0: 1}
    for d in divisors(n)[:-1]:
        u = {}
        for k in dp.keys():
            if (s := (d + k)) <= n:
                u[s] = dp.get(s, 0) + dp[k]
                if s == n and u[s] > 1:
                    return False
        for k,v in u.items():
            dp[k] = v
    return dp.get(n, 0) == 1
print([n for n in range(1, 1039) if isok(n)]) # _Dar√≠o Clavijo_, Sep 17 2024

